import React from "react";
import 'bootstrap/dist/css/bootstrap.css';
import { Container, Row, Col } from "react-bootstrap";
import '../../styles/styles.css';

export default function TestcaseSection(){
    let [question, setQuestion] = useState([]);

    useEffect(() => {
      fetch("http://localhost:3001/31")
        .then(res => res.json())
        .then(data => {
            setQuestion(data);
          },
          (error) => {
            setQuestion(error);
          }
        )
    }, []);

    return(
        <div class="testcase-section">
            <Container>
                <Row>TESTCASE</Row>
                <Row>
                <Col>Testcase 1</Col>
                {question.map(quest => {
                    const {
                    testcase_input_1,
                    testcase_output_1,
                    } = quest;
                    return (
                        <Col>
                            <Row>Input: {testcase_input_1}</Row>
                            <Row>Output: {testcase_output_1}</Row>
                        </Col>
                    );
                })}
                </Row>
            </Container>
        </div>
    );
};
